import React from "react";

const Header = () => {
  return (
    <div className="sixteen wide column">
      <div class="ui top fixed menu">
        <div class="item">
          <img src="/images/logo.png" />
        </div>
        <a class="item">Features</a>
        <a class="item">Testimonials</a>
        <a class="item">Sign-in</a>
      </div>
    </div>
  );
};

export default Header;
